require(["lodash"], function(_){
    var check = {};
    var descriptions = getDescriptions();
    console.log("descriptions:   ", descriptions);
    var states = API.getVariable("states").getValue();
    var svgmodifier = getBaseModifier();
    var actions = getActions();



    // ========================================
    // Check functions
    // ========================================
    check.replaceMouse = function(action) {
        return !states[action.source].isAlive;
    };

    check.replaceMix = function(action) {
        return action.source === action.dest;
    };

    check.replaceMouse = function(action) {
        return action.source === action.dest;
    };

    check.mixToMix = function(action) {
        return action.source !== action.dest;
    };

    check.mixToMouse = function(action){
        return states[action.dest].isAlive;
    };

    function getType(id) {
        switch(id) {
            case "mix2":
            case "mix1":
                return "mix";
            case "mouse-left":
            case "mouse-right":
            case "mouse-center":
                return "mouse";
            case "becher-virulent":
            case "becher-non-virulent":
                return "becher";
            default:
                return id;
        }
    }

    function getAllIds() {
        return [
            "horloge",
            "becher-virulent",
            "becher-non-virulent",
            "mouse-left",
            "mouse-center",
            "mouse-right",
            "bec",
            "mix1",
            "mix2",
            "microscope"
        ];
    }

    function getAllIdsByType(type) {
        var r = [];
        var ids = getAllIds();
        for(var i=0; i<ids.length; i++) {
            if(getType(ids[i]) === type) r.push(ids[i]);
        }
        return r;
    }

    function getActionList(source) {
        var act = _.cloneDeep(DataObject.resurrect(actions));
        act = filterActionSource(act, source);
        act = filterActionDest(act, source);
        act = filterActionDuplicates(act, source);
        act = filterActionState(act, source);
        act = filterActionTemplate(act, source);
        act = filterActionHighlight(act, source);

        if(act.length === 0) {
            act.push({
                label: "Pas d\"actions disponibles",
                action: "noAction",
                source: source
            });
        }
        return act;
    }

    function filterActionSource(actions, source) {
        for(var i=0; i<actions.length; i++) {
            if(actions[i].source !== source && getType(source) === actions[i].source) {
                actions[i].source = source;
            }
            else if(actions[i].source !== source) {
                delete actions[i];
            }
        }
        return _.compact(DataObject.resurrect(actions));
    }

    function filterActionDest(actions) {
        for(var i=0; i<actions.length; i++) {
            if(getType(actions[i].dest) === actions[i].dest) {
                var destinations = getAllIdsByType(actions[i].dest);
                destinations = destinations.map(function(d) {
                    var x = _.cloneDeep(actions[i]);
                    x.dest = d;
                    return x;
                });
                actions[i] = destinations;
            }
        }

        actions = _.flatten(actions);
        return actions;
    }

    function filterActionDuplicates(actions) {
        return  _.uniq(actions, function(action) {return action.source + action.dest + action.action});
    }

    function filterActionState(actions) {
        for(var i=0; i<actions.length; i++) {
            _.filter(actions)
        }
        return _.filter(actions, function(action) {
            if(!check[action.check]) return true;
            return check[action.check](action);
        });
    }

    function filterActionTemplate(actions) {
        for(var i=0; i<actions.length; i++) {
            if(actions[i].label) {
                var obj = {
                    source: states[actions[i].source],
                    dest: states[actions[i].dest]
                };
                actions[i].label = _.template(actions[i].label)(obj);
            }
        }
        return actions;
    }

    function filterActionHighlight(actions) {
        for(var i=0; i<actions.length; i++) {
            actions[i]._highlight = actions[i].dest;
        }
        return actions;
    }

    function getBaseModifier() {
        var r = getAllIds().map(function(val){
            return {
                selector: "#"+val,
                info: {
                    id: val,
                    kind: "fromsvg",
                    description: descriptions[val] || ""
                },
                _highlight: val
            };
        });
        return r;
    }



    // ==================================================
    // Var getters
    // ==================================================
    function getDescriptions() {
        var desc = {
            mouse: "Une <strong>souris</strong>. Vérifie tes hypothèses en lui injectant une solution que tu a préparé.",
            mix: "Une <strong>solution</strong>. A la base cette solution ne contient pas de bactéries. Effectue un mélange à partir des préparations de bases et d autres solutions que tu a préparé.",
            bec: "Un <strong>bec benzène</strong>, pour chauffer tes solutions. Cela tuera toutes les bactéries à l intérieur.",
            "becher-virulent": "Un becher contenant une souche de bactéries virulentes.",
            "becher-non-virulent": "Un becher contenant une souche de bactéries non-virulentes"
        };

        var ids = getAllIds();
        var d = {};
        for(var i=0; i<ids.length; i++) {
            d[ids[i]] = {
                type: "html",
                value: "<div style=\"font-size: 14px\";>" + (desc[getType(ids[i])] || "") + ((ids[i] === getType(ids[i])) ? "" : (desc[ids[i]] || "")) + "</div>"
            };
        }
        return d;
    }

    function getActions() {
        return [
            {
                source: "becher",
                dest: "mouse",
                label: "Injecter <%- source.name %> à <%- dest.name %>",
                action: "becherToMouse",
                check: "becherToMouse"
            },
            {
                source: "becher",
                dest: "mix",
                label: "Ajouter <%- source.name %> à <%- dest.name %>",
                check: "becherToMix",
                action: "becherToMix"
            },
            {
                source: "mix",
                dest: "mouse",
                label: "Injecter <%- source.name %> à <%- dest.name %>",
                check: "mixToMouse",
                action: "mixToMouse"
            },
            {
                source: "mix",
                dest: "mix",
                label: "Verser <%- source.name %> dans <%- dest.name %>",
                check: "mixToMix",
                action: "mixToMix"
            },
            {
                source: "mix",
                dest: "mix",
                label: "Remplacer <%- source.name %>",
                check: "replaceMix",
                action: "replaceMix"
            },
            {
                source: "mix",
                dest: "bec",
                label: "Chauffer <%- source.name %> avec le <%- dest.name %>",
                action: "heatMixReverse"
            },
            {
                source: "mix",
                dest: "becher",
                label: "Ajouter <%- dest.name %> à <%- source.name %>",
                action: "mixToBecher"
            },
            {
                source: "bec",
                dest: "mix",
                label: "Chauffer <%- dest.name %> avec le <%- source.name %>",
                check: "heatMix",
                action: "heatMix"
            },
            {
                source: "horloge",
                dest: "horloge",
                label: "Attendre que les cellules se développent en culture...",
                check: "grow",
                action: "grow"
            },
            {
                source: "mouse",
                dest: "mouse",
                label: "Remplacer <%- source.name %>",
                action: "replaceMouse",
                check: "replaceMouse"
            }
        ];
    }

// ======================================================
// Initialize
// ======================================================

// Initialize
    if(!value) {
        // First execution... Send the base modifier to the svg so that it responds to actions
        API.createData("svgmodifier", getBaseModifier());
    }
    if(value.trigger) {
        // First execution... Send the base modifier to the svg so that it responds to actions
        API.createData("svgmodifier", getBaseModifier());
    }

    else {
        // Get actions from state and display them on the table
        var actionList = getActionList(value.id);
        API.createData("actionList", actionList);
        //var actions = getActions(value.id, getType(value.id));
    }
});

require(["lodash"], function(_){

    var methods = {};
    var check = {};
    var anim = {};
    var descriptions = getDescriptions();
    var states = API.getVariable("states").getValue();
    var svgmodifier = getBaseModifier();
    var indexMap = getIndexMap();

    var lastActions = API.getVariable("lastActionsArr").getValue();
    if(!lastActions) {
        lastActions = [];
    }

    // ======================================
    // METHODS
    // ======================================
    methods.grow = function(value) {
        var mixes = getAllIdsByType("mix");
        var doAnim = false;
        for(var i=0; i<mixes.length; i++) {
            var state = states[mixes[i]];
            if(state.hasNonVirulent && state.hasVirulentDead) {
                doAnim = true;
                state.hasVirulent = true;
            }
            state.isGrown = true;
        }
        anim.grow(value);
        anim.micViewChange("mix1", doAnim);
        anim.micViewChange("mix2", doAnim);
    };



    methods.becherToMouse = function(value) {
        switch(value.source) {
            case "becher-non-virulent":
                // does not affect state of mouse
                break;
            case "becher-virulent":
                states[value.dest].isAlive = false;
                updateMouseView(value.dest);
                break;
        }
    };

    methods.becherToMix = function(value) {
        switch(value.source) {
            case "becher-non-virulent":
                states[value.dest].hasNonVirulent = true;
                anim.becherToMix(value);
                break;
            case "becher-virulent":
                states[value.dest].hasVirulent = true;
                anim.becherToMix(value);
                break;
        }
        anim.micViewChange(value.dest);
    };

    methods.mixToBecher = function(value) {
        methods.reverseOf("becherToMix", value);
    };

    methods.mixToMouse = function(value) {
        if(states[value.source].hasVirulent) {
            states[value.dest].isAlive = false;
            updateMouseView(value.dest);
        }
    };



    methods.mixToMix = function(value) {
        ["hasVirulent", "hasVirulentDead", "hasNonVirulent", "hasNonVirulentDead"].forEach(function(prop) {
            states[value.dest][prop] = states[value.dest][prop] || states[value.source][prop];
        });
        anim.mixToMix(value);
        anim.micViewChange(value.dest);
    };

    methods.replaceMix = function(value) {
        ["hasVirulent", "hasVirulentDead", "hasNonVirulent", "hasNonVirulentDead"].forEach(function(prop) {
            states[value.dest][prop] = false;
        });
        anim.micViewChange(value.source);
    };

    methods.heatMix = function(value) {
        if(states[value.dest].hasVirulent) {
            states[value.dest].hasVirulent = false;
            states[value.dest].hasVirulentDead = true;
        }
        if(states[value.dest].hasNonVirulent) {
            states[value.dest].hasNonVirulent = false;
            states[value.dest].hasNonVirulentDead = true;
        }
        anim.heatMix(value);
        anim.micViewChange(value.dest);
    };

    methods.reverseOf = function(methodName, value) {
        var val = _.clone(value);
        val.dest = value.source;
        val.source = value.dest;
        methods[methodName](val);
    }

    methods.heatMixReverse = function(value) {
        methods.reverseOf("heatMix", value);

    };

    methods.replaceMouse = function(value) {
        states[value.source].isAlive = true;
        updateMouseView(value.source);
    };

    methods.noAction = function() {
        // do nothing
        console.log("no action");
    };

    // ========================================
    // Anim function
    // ========================================
    anim.micViewChange = function(mix, anim) {
        var outName;
        if(mix === "mix1") {
            outName = "s1modifier";
        }
        else if(mix === "mix2") {
            outName = "s2modifier";
        }
        var state = states[mix];

        //When the result is ready, use resolve(result) to send it.
//In case of an error, use reject(error)
        var thestyle = "fill:#000000;fill-opacity:1;stroke:#ffffff;stroke-miterlimit:4;stroke-opacity:0.89166667;stroke-dasharray:none;stroke-dashoffset:0;display:inline;";


        var rlim = 0;
        if(state.hasVirulent && state.hasNonVirulent) rlim = 0.5;
        else if(state.hasVirulent) rlim = 0;
        else rlim = 1;


        var cellSize = 0;
        if(state.hasVirulent || state.hasNonVirulent) cellSize = 1;
        else if(state.hasVirulentDead || state.hasNonVirulentDead) cellSize = 0.1;
        else cellSize = 0;


        var svgmod = {
            selector: ".cell",
            attributes: {
                style: function() {
                    var x = Math.random();
                    var style = thestyle;
                    if(x<rlim) {
                        return style + "stroke-width: 0;";
                    }
                    else {
                        return style + "stroke-width: 0.7;";
                    }
                }
            },
            animation: {
                tag: "animateTransform",
                attributes: {
                    attributeName: "transform",
                    fill: "freeze",
                    type: "scale",
                    dur: anim ? "2s" : "0.01s",
                    from: "0",
                    to: cellSize.toString(),
                    calcMode: anim ? undefined : "discrete"
                },
                options: {
                    clearOnEnd: false,
                    persistOnEnd: false,
                    clearAnimationTagsBeforeBegin: false
                }
            }
        };
        API.createData(outName, svgmod);


    };

    anim.mixToMix = function(value) {

    };

    anim.mixToMouse = function(value) {

    };

    anim.heatMix = function(value) {
        var animId = Math.random().toString(36).substr(2);
        var x,y, idx;
        idx = _.findIndex(svgmodifier, function(m) {
          return m._highlight === value.dest;
        });
        if(!idx) return;
        switch(value.dest) {
            case "mix1":
                x=225; y=168;
                break;
            case "mix2":
                x=410; y=168;
                break;
        }
        svgmodifier[idx].animation =  {
            tag: "animateTransform",
            attributeName: "transform",
            fill: "freeze",
            type: "translate",
            dur: "1s",
            additive: "sum",
            cumulative: "sum",
            keySplines: ".5 0 .5 1",
            calcMode: "spline",
            keyTimes:"0; 1",
            attributes: [
                {
                    id: animId,
                    from: "0,0",
                    to: (-x).toString() + " " + (-y).toString()
                },
                {
                    from: "0,0",
                    begin: animId+".end+2s",
                    to: x.toString() + " " + y.toString()
                }
            ],
            options: {
                clearOnEnd: false,
                persistOnEnd: false,
                clearAnimationTagsOnEnd: false,
                clearAnimationTagsBeforeBegin: true
            }
        }
    };

    anim.becherToMix = function(value) {

    };

    anim.grow = function(value) {
        svgmodifier.push(
            {
                "selector": "#" + value.source + " #clockhand_minutes",
                "animation": {
                    "tag": "animateTransform",
                    "attributes": {
                        "attributeName": "transform",
                        "fill": "freeze",
                        "type": "rotate",
                        "dur": "3s",
                        "from": 0,
                        "to": "2880",
                        "additive": "sum",
                        "accumulate": "sum",
                        "calcMode": "spline",
                        "keySplines": "0.5 0 0.5 1"
                    },
                    "options": {
                        "clearOnEnd": false,
                        "persistOnEnd": false
                    }
                }
            },
            {
                "selector": "#" + value.source + " #clockhand_hours",
                "animation": {
                    "tag": "animateTransform",
                    "attributes": {
                        "attributeName": "transform",
                        "fill": "freeze",
                        "type": "rotate",
                        "dur": "3s",
                        "from": "0",
                        "to": "240",
                        "additive": "sum",
                        "accumulate": "sum",
                        "calcMode": "spline",
                        "keySplines": "0.5 0 0.5 1"
                    },
                    "options": {
                        "clearOnEnd": false,
                        "persistOnEnd": false
                    }
                }
            });
    };
    // ========================================
    // Check functions
    // ========================================
    check.replaceMouse = function(action) {
        return !states[action.source].isAlive;
    };

    check.replaceMix = function(action) {
        return action.source === action.dest;
    };

    check.replaceMouse = function(action) {
        return action.source === action.dest;
    };

    check.mixToMix = function(action) {
        return action.source !== action.dest;
    };

    check.mixToMouse = function(action){
        return states[action.dest].isAlive;
    };

    function getType(id) {
        switch(id) {
            case "mix2":
            case "mix1":
                return "mix";
            case "mouse-left":
            case "mouse-right":
            case "mouse-center":
                return "mouse";
            case "becher-virulent":
            case "becher-non-virulent":
                return "becher";
            default:
                return id;
        }
    }

    function getAllIds() {
        return [
            "horloge",
            "becher-virulent",
            "becher-non-virulent",
            "mouse-left",
            "mouse-center",
            "mouse-right",
            "bec",
            "mix1",
            "mix2"
        ];
    }

    function getAllIdsByType(type) {
        var r = [];
        var ids = getAllIds();
        for(var i=0; i<ids.length; i++) {
            if(getType(ids[i]) === type) r.push(ids[i]);
        }
        return r;
    }

    function getBaseModifier() {
        var r = getAllIds().map(function(val){
            return {
                selector: "#"+val,
                info: {
                    id: val,
                    kind: "fromsvg",
                    description: descriptions[val] || ""
                },
                _highlight: val
            };
        });
        return r;
    }

    function updateView() {
        // Update mice
        var mice = ["mouse-left", "mouse-center", "mouse-right"];
        for(var i=0; i<mice.length; i++) {
            updateMouseView(mice[i]);
        }
    }

    function updateMouseView(id) {
        var attributes = svgmodifier[indexMap[id]].attributes = svgmodifier[indexMap[id]].attributes || {};
        if(states[id].isAlive) {
            attributes["xlink:href"] = "#mouse-alive";
        }
        else {
            attributes["xlink:href"] = "#mouse-dead";
        }
    }

    function getIndexMap() {
        var r = {};
        for(var i=0; i<svgmodifier.length; i++) {
            r[svgmodifier[i].info.id] = i;
        }
        return r;
    }


// =============================================
// Add action methods
// =============================================
    function addInjectMouseFromBecher(dest, source, actionList) {
        if(states[dest].isAlive) {
            actionList.push({
                label: "Injecter à la souris " + dest,
                action: "inject",
                dest: dest,
                _highlight: dest,
                source: source
            });
        }
    }



    // ==================================================
    // Var getters
    // ==================================================
    function getDescriptions() {
        var desc = {
            mouse: "Une <strong>souris</strong>. Vérifie tes hypothèses en lui injectant une solution que tu a préparé.",
            mix: "Une <strong>solution</strong>. A la base cette solution ne contient pas de bactéries. Effectue un mélange à partir des préparations de bases et dautres solutions que tu a préparé.",
            bec: "Un <strong>bec benzène</strong>, pour chauffer tes solutions. Cela tuera toutes les bactéries à lintérieur.",
            "becher-virulent": "Un <strong>becher</strong> contenant une souche de bactéries virulentes.",
            "becher-non-virulent": "Un <strong>becher</strong> contenant une souche de bactéries non-virulentes"
        };

        var ids = getAllIds();
        var d = {};
        for(var i=0; i<ids.length; i++) {
            d[ids[i]] = {
                type: "html",
                value: "<div style=\"font-size: 14px\";>" + (desc[getType(ids[i])] || "") + ((ids[i] === getType(ids[i])) ? "" : (desc[ids[i]] || "")) + "</div>"
            };
        }
        return d;
    }

    function getActions() {
        return [
            {
                source: "becher",
                dest: "mouse",
                label: "Injecter <%- source.name %> à <%- dest.name %>",
                action: "becherToMouse",
                check: "becherToMouse"
            },
            {
                source: "becher",
                dest: "mix",
                label: "Ajouter <%- source.name %> à <%- dest.name %>",
                check: "becherToMix",
                action: "becherToMix"
            },
            {
                source: "mix",
                dest: "mouse",
                label: "Injecter <%- source.name %> à <%- dest.name %>",
                check: "mixToMouse",
                action: "mixToMouse"
            },
            {
                source: "mix",
                dest: "mix",
                label: "Verser <%- source.name %> dans <%- dest.name %>",
                check: "mixToMix",
                action: "mixToMix"
            },
            {
                source: "mix",
                dest: "mix",
                label: "Remplacer <%- source.name %>",
                check: "replaceMix",
                action: "replaceMix"
            },
            {
                source: "bec",
                dest: "mix",
                label: "Chauffer <%- dest.name %> avec le <%- source.name %>",
                check: "heatMix",
                action: "heatMix"
            },
            {
                source: "horloge",
                dest: "horloge",
                label: "Attendre que les cellules se développent en culture...",
                check: "grow",
                action: "grow"
            },
            {
                source: "mouse",
                dest: "mouse",
                label: "Remplacer <%- source.name %>",
                action: "replaceMouse",
                check: "replaceMouse"
            }
        ];
    }

// ======================================================
// Initialize
// ======================================================

    lastActions.push(value.label);
    var lastActionsHtml = _.chain(lastActions).map(function(act) {
        return "<li>" + act + "</li>";
    }).join("");
    lastActionsHtml = "<ol>" + lastActionsHtml + "</ol>";
    API.createData("lastActions", {
        type: "html",
        value: lastActionsHtml
    });

    API.createData("lastActionsArr", lastActions);
    methods[value.action](value);
    API.createData("states", states);
    API.createData("svgmodifier", svgmodifier);


});
